import React from "react";
function NavBar({onChangePage,currentPage}){
  function handleLinkClick(e){
    e.preventDefault()
    onChangePage(e.target.pathname)
    currentPage
  }
  return (
    <nav>
      <a onClick={handleLinkClick} href="/">Home</a>
      <a onClick={handleLinkClick} href="/itemForm">Form</a>
      <a onClick={handleLinkClick} href="/item">Matches</a>
    </nav>
  )
}
export default NavBar
